require 'spec_helper'

describe Bitcoin::Message::CFHeaders do

  describe '#parse_from_payload', network: :regtest do
    subject {
      Bitcoin::Message::CFHeaders.parse_from_payload(''.htb)
    }
    it 'should be parsed.' do
      expect(subject.filter_type).to eq(0)
      expect(subject.stop_hash).to eq('498fc25f2126fb1180345d594f91d5a432d7725dbc2c0d4ee639986cf1253f67')
      expect(subject.stop_hash.htb.bytesize).to eq(32)
      expect(subject.filter_hashes.size).to eq(1_000)
      expect(subject.filter_hashes.first).to eq('9c43b77346d2548664cc75d714f686ae6dc1f070bc2d8954ecfa1bc28c3d69a1')
      expect(subject.to_pkt.bth).to eq('')
    end
  end

end